import "./styles.css";

export default function App() {
  return (
    <div className="App">
      <h3>Button Variants</h3>
      <div>
        <h3>Outlined Button</h3>
      </div>
      <div>
        <h3>Filled Button</h3>
      </div>
    </div>
  );
}
